import React, { Component } from "react";
import Typewriter from "typewriter-effect";
import "./style.css";
import TextField from "@material-ui/core/TextField";
import { getDetails } from "./cardDetails";
class TypeWriterC extends Component {
  state = {
    cards: [],
    filter: "",
  };

  componentDidMount() {
    this.setState({ cards: getDetails() });
  }
  getData = (e) => {
    console.log(e.target.value);
    this.setState({ filter: e.target.value });
  };
  render() {
    return (
      <React.Fragment>
         <div className="d-flex justify-content-end Cards">
          <TextField
            id="standard-basic"
            label="Search"
            color="secondary"
            onChange={this.getData}
          />
        </div>
        <div className="type display-3">
          <Typewriter
            options={{
              strings: [
                "Path-Finder",
                "Recursion Tree",
                "Sorting Algorithm",
                "Recursive Sorting",
                "N Queen",
                "Turing Machine",
                "Prime Numbers",
                "Convex Hull",
                "Binary Search",
                "15 Puzzles",
              ],
              autoStart: true,
              loop: true,
            }}
          />
        </div>


      </React.Fragment>
    );
  }
}

export default TypeWriterC;
